import { motion } from 'framer-motion'

export default function Services() {
    return (
        <motion.div 
            initial={{ opacity: 0 }}
            animate={{ opacity: 1 }}
            exit={{ opacity: 0 }} 
            id="services-content" 
            className="content">
            SERVICES
        </motion.div> 
    )
}
